import axios from "axios"
import { useDispatch } from "react-redux"
import { getData } from "../features/dataPizzaSlice"

const dispatch = useDispatch()

const urlPIZZA = "http://localhost:5000/api/private"

export const getDataPizza = async () => {
    await axios.get(`${urlPIZZA}/read/pizza`)   
        .then(res => {
        dispatch(getData(res))
    })
}
